INSERT INTO `campus_card_announcement` VALUES (12, 1, '2019-03-31 12:31:19', '关于中国建设银行年终结转影响一卡通系统银校转账业务的通知', '<p class=\"MsoNormal\"><span>&nbsp; &nbsp; &nbsp; &nbsp; 因中国建设银行年终结转工作需要，<span lang=\"EN-US\">2018</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">28</span>日<span lang=\"EN-US\">17:00</span>至<span lang=\"EN-US\">2019</span>年<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">1</span>日<span lang=\"EN-US\">9:00</span>所有校园一卡通系统银校转账相关业务暂停使用（包括玉兰卡建行充值、“<span lang=\"EN-US\">i</span>大工”移动平台充值和缴费等）。暂停期间不影响玉兰卡刷卡消费，请大家提前做好玉兰卡充值，提前办理相关自助缴费。对于给您带来的不便，请您谅解，望周知。</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span>网络与信息化中心</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span lang=\"EN-US\">2018</span><span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">25</span>日</span></p>'), (13, 1, '2019-03-31 12:34:36', '关于校园玉兰卡增加明珠公交卡功能的通知', '<p class=\"MsoNormal\"><span>全校师生：</span></p><p class=\"MsoNormal\"><span>为方便师生日常出行，网络与信息化中心与大连公交明珠集团联合推出了新版玉兰卡，将玉兰卡与明珠公交卡功能结合，既可以在校内使用也可以在校外公交、地铁等场所使用。</span></p><p class=\"MsoNormal\"><span>新版玉兰卡是将玉兰卡和明珠卡介质合二为一，相当于一张卡上集成了两个钱包，校园卡钱包和明珠卡钱包各自独立，两个钱包各自在自己的系统中使用。明珠卡的钱包不可挂失，当丢卡挂失补办时，明珠卡钱包里的余额不能找回，建议不要充值太多。<span lang=\"EN-US\">2018</span>年入校新生已经使用新版玉兰卡，其他师生可以来网信中心服务大厅办理，工本费与原卡一致。目前自助补卡机只能补办不带明珠卡功能的卡片。预计在<span lang=\"EN-US\">10</span>月<span lang=\"EN-US\">15</span>日完成升级切换，可以补办新卡。</span></p><p class=\"MsoNormal\"><span>新版玉兰卡充值明珠卡钱包方式如下：</span></p><p class=\"MsoNormal\"><span>方式一：线上充值。含有<span lang=\"EN-US\">NFC</span>功能的安卓手机，需要打开手机的<span lang=\"EN-US\">NFC</span>功能，下载“大连明珠卡”软件，选择“NFC充值”，将卡片贴近手机背部，进行读写卡操作充值。</span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;&nbsp;<img width=\"350\" height=\"600\" title=\"undefined\" id=\"图片 1\" alt=\"undefined\" src=\"http://ecard.dlut.edu.cn/__local/6/F0/BF/8CDA7A2BB7FD30DE13CACED8CC1_250A60E7_13740.jpg\" border=\"0\" vspace=\"0\" hspace=\"0\" vwidth=\" 350px\" vheight=\" 600px\" vurl=\"/_vsl/6F0BF8CDA7A2BB7FD30DE13CACED8CC1/250A60E7/13740\" vsbhref=\"vurl\" orisrc=\"/__local/6/F0/BF/8CDA7A2BB7FD30DE13CACED8CC1_250A60E7_13740.jpg\" class=\"img_vsb_content\">&nbsp; &nbsp;&nbsp;<img width=\"350\" height=\"600\" title=\"undefined\" id=\"图片 2\" alt=\"undefined\" src=\"http://ecard.dlut.edu.cn/__local/1/50/04/B201A6EFA0D3A6B01AEA8E9F4BE_E30CAA98_A861.jpg\" border=\"0\" vspace=\"0\" hspace=\"0\" vwidth=\" 350px\" vheight=\" 600px\" vurl=\"/_vsl/15004B201A6EFA0D3A6B01AEA8E9F4BE/E30CAA98/A861\" vsbhref=\"vurl\" orisrc=\"/__local/1/50/04/B201A6EFA0D3A6B01AEA8E9F4BE_E30CAA98_A861.jpg\" class=\"img_vsb_content\"></span></p><p class=\"MsoNormal\"><span>方式二：线下充值。和常规明珠卡一样在校外充值网点进行充值，如大连银行、大连市邮政局、公交地铁自助充值终端等。</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span><span>在使用过程中如有建议或问题，可拨打电话<span lang=\"EN-US\">84707007</span>或发送电子邮件到<span lang=\"EN-US\">ecard@dlut.edu.cn</span>进行咨询。</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span>网络与信息化中心</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span lang=\"EN-US\">2018</span><span>年<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">12</span>日</span></p>'), (14, 1, '2019-03-31 12:35:31', '关于一卡通电子支付平台关闭的通知', '<p class=\"MsoNormal\"><span>全校师生：</span></p><p class=\"MsoNormal\"><span>因我校已开通移动端玉兰卡功能，一卡通电子支付平台的自助缴费相关服务都可以在移动端或校园卡自助终端机完成，网络与信息化中心经研究决定将于<span lang=\"EN-US\">8</span>月<span lang=\"EN-US\">1</span>日起关闭一卡通电子支付平台，不再对其进行维护。</span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;&nbsp;<img width=\"338\" height=\"176\" id=\"图片 5\" src=\"http://ecard.dlut.edu.cn/__local/0/CD/26/E24A26EAA3B1229DCF4F43677B0_8A85C138_2A54.jpg\" vwidth=\"338\" vheight=\"176\" vurl=\"/_vsl/0CD26E24A26EAA3B1229DCF4F43677B0/8A85C138/2A54\" vsbhref=\"vurl\" orisrc=\"/__local/0/CD/26/E24A26EAA3B1229DCF4F43677B0_8A85C138_2A54.jpg\" class=\"img_vsb_content\"></span></p><p class=\"MsoNormal\"><span>其自助缴费功能可以由以下两种方式代替：</span></p><p class=\"MsoNormal\"><span>方式一：</span><span>线上支付</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span>打开“<span lang=\"EN-US\">i</span>大工”进入“玉兰卡”界面，即可进行自助缴费。</span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;&nbsp;<img width=\"170\" height=\"298\" id=\"图片 1\" src=\"http://ecard.dlut.edu.cn/__local/7/52/86/E29BA5DA51A7671B38CEB39443D_55B907CD_1F58.jpg\" vwidth=\"170\" vheight=\"298\" vurl=\"/_vsl/75286E29BA5DA51A7671B38CEB39443D/55B907CD/1F58\" vsbhref=\"vurl\" orisrc=\"/__local/7/52/86/E29BA5DA51A7671B38CEB39443D_55B907CD_1F58.jpg\" class=\"img_vsb_content\"></span><span lang=\"EN-US\">&nbsp;&nbsp; &nbsp;&nbsp;<img width=\"171\" height=\"297\" src=\"http://ecard.dlut.edu.cn/__local/2/49/DF/C2603758CFD30825A3A759E9D6A_71CBF55D_1AF3.jpg\" vwidth=\"171\" vheight=\"297\" vurl=\"/_vsl/249DFC2603758CFD30825A3A759E9D6A/71CBF55D/1AF3\" vsbhref=\"vurl\" orisrc=\"/__local/2/49/DF/C2603758CFD30825A3A759E9D6A_71CBF55D_1AF3.jpg\" class=\"img_vsb_content\"></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span>方式二：</span><span>线下支付</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span>通过“校园卡自助终端机”实现自助缴费。</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;&nbsp;<img width=\"284\" height=\"191\" id=\"图片 2\" src=\"http://ecard.dlut.edu.cn/__local/7/BD/14/856DBCFC7612A25F0C2F860CFF8_D848B7B0_106A2.png\" vwidth=\"284\" vheight=\"191\" vurl=\"/_vsl/7BD14856DBCFC7612A25F0C2F860CFF8/D848B7B0/106A2\" vsbhref=\"vurl\" orisrc=\"/__local/7/BD/14/856DBCFC7612A25F0C2F860CFF8_D848B7B0_106A2.png\" class=\"img_vsb_content\"></span></p><p class=\"MsoNormal\"><span>在使用过程中如有建议或问题，可拨打电话<span lang=\"EN-US\">84707007</span>或发送电子邮件到<span lang=\"EN-US\">ecard@dlut.edu.cn</span>进行咨询。</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span>网络与信息化中心</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span lang=\"EN-US\">2018</span><span>年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">28</span>日</span></p>'), (15, 1, '2019-03-31 12:38:17', '关于网信中心2019年暑假值班安排的通知', '<p><span>&nbsp; 校园网及一卡通用户：</span></p><p><span></span></p><p><span>&nbsp; 为做好假期各项工作，保障学校科研等工作正常稳定运行，网信中心依照学校工作部署，暑假期间相关服务工作安排如下：</span></p><p><span></span></p><p><span>&nbsp; &nbsp; 1、科研教学设备专用地址申请截止到2018年7月31日。</span></p><p>&nbsp; &nbsp; 2、学生认证上网服务月租2018年8月份减半，为10元/月。</p><p><span></span></p><p><span>&nbsp; &nbsp; 3、网络报修照常到“校园网自助服务系统”提交。业务咨询请拨打呼叫中心电话：84707007。维修问题沟通请在值班时间内拨打维修热线：81987000、81988000，维修人员将在值班期间进行处理。</span></p><p><span></span></p><p><span>&nbsp; &nbsp; 4、校园网主干设备及服务器正常运行。</span></p><p><span></span></p><p><span>&nbsp; &nbsp; 5、为了使您的网络畅通，请及时缴费，以免被系统自动停止服务。</span></p><p><span></span></p><p><span>&nbsp; &nbsp; 6、数据中心各项服务申请截至到2018年7月24日，数据中心各项服务正常运行。</span></p><p><span></span></p><p><span>&nbsp; &nbsp; 7、服务大厅、呼叫中心及网络维修值班安排如下：</span></p><p><span></span></p><p><span>&nbsp; 值班日期为：7月30日-8月30日（不含双休日）。</span></p><p><span></span></p><p><span>&nbsp; 服务大厅、呼叫中心值班时间为：08：30～11：30。</span></p><p><span></span></p><p><span>&nbsp; 网络维修值班时间为：08：30～11：30，13：30～16：30。</span></p><p><span></span></p><p><span>&nbsp; 祝全校师生暑假愉快！</span></p>'), (16, 1, '2019-03-31 12:39:12', '关于一卡通增加虚拟卡功能的通知', '<p class=\"MsoNormal\"><span>全校师生：</span></p><p class=\"MsoNormal\"><span>为了方便师生校园消费，网络与信息化中心推出“虚拟校园卡”功能，只要你携带着手机，就可以通过这项功能在食堂进行无卡消费。现阶段，虚拟卡主要使用区域为凌水校区各大食堂的部分窗口，今后还将应用到门禁、通道、签到等身份认证场所。</span></p><p class=\"MsoListParagraph\"><strong><span lang=\"EN-US\">1、<span>&nbsp;</span></span></strong><strong><span>虚拟卡如何认领</span></strong></p><p class=\"MsoNormal\"><span>打开“<span lang=\"EN-US\">i</span>大工”进入“玉兰卡”界面，点击“去消费”即可。</span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;</span></p><table class=\"MsoTableGrid layui-table\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr class=\"firstRow\"><td width=\"277\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp;&nbsp;<img width=\"149\" height=\"265\" id=\"图片 7\" src=\"http://ecard.dlut.edu.cn/__local/4/23/25/E381DE342A019E816635E1A8026_9B90FE0E_1CD5.jpg\" vwidth=\"149\" vheight=\"265\" vurl=\"/_vsl/42325E381DE342A019E816635E1A8026/9B90FE0E/1CD5\" vsbhref=\"vurl\" orisrc=\"/__local/4/23/25/E381DE342A019E816635E1A8026_9B90FE0E_1CD5.jpg\" class=\"img_vsb_content\"></span></p></td><td width=\"277\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp;&nbsp;<img width=\"149\" height=\"265\" id=\"图片 8\" src=\"http://ecard.dlut.edu.cn/__local/D/7C/29/2CDDC3AA84C423D364B1D94539B_DE6CCC19_8280.png\" vwidth=\"149\" vheight=\"265\" vurl=\"/_vsl/D7C292CDDC3AA84C423D364B1D94539B/DE6CCC19/8280\" vsbhref=\"vurl\" orisrc=\"/__local/D/7C/29/2CDDC3AA84C423D364B1D94539B_DE6CCC19_8280.png\" class=\"img_vsb_content\"></span></p></td></tr></tbody></table><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoListParagraph\"><strong><span lang=\"EN-US\">2、<span>&nbsp;</span></span></strong><strong><span>虚拟卡如何充值</span></strong></p><p class=\"MsoNormal\"><span>方式一：线上充值。通过“<span lang=\"EN-US\">i</span>大工”的“虚拟卡充值”即可实现银行卡向虚拟卡的充值。</span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;</span></p><table class=\"MsoTableGrid layui-table\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr class=\"firstRow\"><td width=\"277\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp;&nbsp;<img width=\"144\" height=\"257\" id=\"图片 9\" src=\"http://ecard.dlut.edu.cn/__local/7/C2/19/45617E1AB622038F855432A0ED2_0535CDA1_1B17.jpg\" vwidth=\"144\" vheight=\"257\" vurl=\"/_vsl/7C21945617E1AB622038F855432A0ED2/0535CDA1/1B17\" vsbhref=\"vurl\" orisrc=\"/__local/7/C2/19/45617E1AB622038F855432A0ED2_0535CDA1_1B17.jpg\" class=\"img_vsb_content\"></span></p></td><td width=\"277\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp;&nbsp;<img width=\"146\" height=\"262\" id=\"图片 11\" src=\"http://ecard.dlut.edu.cn/__local/A/7F/8B/E5582D9CC43C05261D2E9E4B9F6_86B66F42_15EE.jpg\" vwidth=\"146\" vheight=\"262\" vurl=\"/_vsl/A7F8BE5582D9CC43C05261D2E9E4B9F6/86B66F42/15EE\" vsbhref=\"vurl\" orisrc=\"/__local/A/7F/8B/E5582D9CC43C05261D2E9E4B9F6_86B66F42_15EE.jpg\" class=\"img_vsb_content\"></span></p></td></tr></tbody></table><p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span>方式二：线下充值。通过“校园卡自助终端机”实现玉兰卡与虚拟卡的互转充值。</span></p><p class=\"MsoListParagraph\"><img width=\"533\" height=\"171\" src=\"http://ecard.dlut.edu.cn/__local/A/59/91/E3100A089E64A98FDDECFEAC344_5E83D7D4_205A3.png\" vwidth=\"533\" vheight=\"171\" vurl=\"/_vsl/A5991E3100A089E64A98FDDECFEAC344/5E83D7D4/205A3\" vsbhref=\"vurl\" orisrc=\"/__local/A/59/91/E3100A089E64A98FDDECFEAC344_5E83D7D4_205A3.png\" class=\"img_vsb_content\"><br clear=\"ALL\"></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span>在使用过程中如有建议或问题，可拨打电话<span lang=\"EN-US\">84707007</span>或发送电子邮件到<span lang=\"EN-US\">ecard@dlut.edu.cn</span>进行咨询。</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span>网络与信息化中心</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span lang=\"EN-US\">2018</span><span>年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">3</span>日</span></p>'), (17, 1, '2019-03-31 12:40:06', '关于一卡通增加虚拟卡功能系统升级的通知', '<p class=\"MsoNormal\"><span>全校师生：</span></p><p class=\"MsoNormal\"><span>网信中心计划于<strong><span lang=\"EN-US\">2018</span>年<span lang=\"EN-US\">6</span>月<span lang=\"EN-US\">25</span>日<span lang=\"EN-US\">20:00</span>至<span lang=\"EN-US\">23:00</span></strong>，对一卡通系统进行升级，此次升级主要增加虚拟卡应用功能。</span></p><p class=\"MsoNormal\"><span>升级期间不影响玉兰卡刷卡消费，但不能进行充值和缴费（网费、电费、图书欠缴费等），请大家提前做好准备。</span></p><p class=\"MsoNormal\"><span>对于此次升级带来的不便，请您谅解。如有任何问题请致电<span lang=\"EN-US\">84707007</span>或发送邮件至<span lang=\"EN-US\">ecard@dlut.edu.cn</span>进行咨询，望周知。</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span>网络与信息化中心</span></p><p class=\"MsoNormal\" style=\"text-align: right;\"><span lang=\"EN-US\">2018</span><span>年</span><span lang=\"EN-US\">6</span><span>月</span><span lang=\"EN-US\">22</span><span>日</span></p>'), (18, 1, '2019-03-31 12:41:07', '关于毕业生办理玉兰卡延期的通知', '<p class=\"vsbcontent_start\">各相关毕业生：</p><p>按照学校毕业生离校工作安排，2018届毕业生的玉兰卡将于2018年7月1日停止使用。毕业生暑假期间如果有用卡需求，请本人于2018年7月1日（9:30-15:00）,7月2日至7月6日（8：00-15：00）到网络与信息化中心服务大厅（软件学院毕业生请到软件学院生活区一舍一卡通办公室，具体时间请关注学院通知）办理玉兰延期业务，逾期不予办理，办理须知如下：</p><p>一、延修同学办理须知</p><p>延修同学需携带玉兰卡到网信中心服务大厅办理延期手续。</p><p>● 持有教务处延修单可申请玉兰卡延期一年。玉兰卡到期后可根据实际情况再次申请延期。</p><p>● 根据教务处提供的本科生其他延修情况，同学可申请玉兰卡延期到2018年9月20日。玉兰卡到期后可根据实际情况再次申请延期。</p><p>如果延修同学在2018年7月1日至2018年10月1日期间通过离校系统毕业，玉兰卡将被统一注销，卡的余额将转入建行学费卡中（请确保建行学费卡在毕业半年内能正常存取款）。</p><p>二、继续攻读硕士及博士同学办理须知</p><p>本校毕业生将继续攻读本校硕士需携带玉兰卡及入学通知书申请玉兰卡延期，继续攻读本校博士的同学须提供博士学号办理玉兰卡延期，玉兰卡延期至2018年9月20日。新学期入学报到领取新玉兰卡后，申请延期的同学请<strong>务必</strong>于2018年10月20日前携带新旧两张玉兰卡到网络与信息化中心服务大厅（软件学院毕业生请到软件学院生活区一舍一卡通办公室，具体时间请关注学院通知）办理旧卡注销及余额转入新卡业务。</p><p>三、根据国防教育学院提供的2018届国防生毕业生名单，网信中心已将玉兰卡有效期调整为2018年7月15日。在毕业生离校前请派专人到网信中心服务大厅办理集体报退手续及退费。</p><p>感谢配合!</p><p style=\"text-align: right;\">网络与信息化中心</p><p class=\"vsbcontent_end\" style=\"text-align: right;\">2018年6月20日</p>'), (19, 1, '2019-04-02 09:19:54', '发布通知测试', '请同学们到主楼参加毕设中期答辩'), (20, 1, '2019-04-02 14:49:54', '发布通知', '毕设中期答辩'), (21, 1, '2019-04-02 14:50:39', '通知', 'f'), (22, 1, '2019-06-06 11:03:29', '发布通知最终测试', '毕设最终答辩'), (23, 1, '2019-06-10 20:25:53', '测试通知', '好的');
COMMIT;

