-- ----------------------------
-- Records of campus_card_rule
-- ----------------------------
BEGIN;
INSERT INTO `campus_card_rule` VALUES (1, '第一条 校园卡的分类、使用对象及权限', '正式卡和临时卡根据办卡对象不同分为若干子类，不同子类的校园卡具有不同的权限（如图书借还、消费、门禁等），其中，正式卡的权限由相应的管理部门审批，临时卡按照“谁管理，谁负责，谁审批”的原则，由学校办公室按照“分类定权限，一类一委托”的原则授权相应管理部门审批。无法确定管理部门的，由学校办公室审批，如需增加权限由学校办公室审批核准。'), (2, '第二条 校园卡的办理', '（一）正式卡的办理<br>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;新生卡采取批量制卡的方式，每学年初，由数字化校园建设办公室牵头，依据教务处、研究生院、国际合作处、港澳台事务办公室、国际文化交流学院、后勤服务产业集团提供的数据，共同完成信息采集、制卡及发卡等工作。新进教师在人事处办理报到手续后，本人凭人事处发放的工作证到校园网用户服务中心办理。</p><br>\r\n\r\n（二）临时卡的办理<br>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;临时卡的办理，需用户所在单位登陆“一站式网上办事大厅”系统（http://hall.cufe.edu.cn）进入“校园卡办理”在线填写《校园卡办理审批表》和《办理校园卡人员信息表》，单位领导审批后，在线提交给相应管理部门审核，如需增加权限，提交学校办公室审核，通过后交由校园网用户服务中心办理。</p>\r\n'), (3, '第三条 校园卡的有效期', '（一）正式卡有效期限\n\n1.在校全日制学生、正式注册的国际学生或执行校、院级学生交换协议来我校学习的国（境）外学生的校园卡有效期严格按照学制或学习期限设定。\n\n2.在编教职工、离退休人员的校园卡长期有效。\n\n（二）临时卡有效期限\n\n1.学校支付经费自聘人员校园卡有效期严格按照聘期期限设定\n\n2.在职研究生的校园卡有效期按照学籍管理部门审批期限设定。\n\n3.非学历教育学生、学校合作方员工和其他人员的校园卡按照相应管理部门和学校办公室审批期限设定。\n\n临时卡首次办理期限原则上最长不超过3年。有效期超过1年的临时卡持有人所在单位或管理部门应加强对临时卡的日常集中管理，不应挪作他用；若发现此类现象，学校有权将卡收回。\n\n（三）校园卡延期、暂停和终止\n\n1.学生凭学籍管理单位批复的转单办理延期、暂停手续；教工和其他人员，登陆“一站式网上办事大厅”系统办理延期、暂停等相关手续。\n\n2.因毕业、退学等情况离校的各类学生，以学籍管理单位确定的期限终止并予以销户；因调离、辞职、离职等情况与学校解除人事关系的教职工，以人事处确定的期限终止并予以销户。\n\n3.持有临时卡用户需要办理延期，由所在单位填写《校园卡办理审批表》，相应管理部门审批并签字盖章后，由网络信息中心办理延期手续；临时卡用户离开学校，所在单位应及时收回临时卡并到网络信息中心办理销户手续。');
COMMIT;

